            "Story": "成为空间站「黑塔」的站长后，艾丝妲的生活相较从前更为忙碌。她需要管理各抒己见的科员，替黑塔回复多如牛毛的信件，以及频繁和公司交涉，从各种渠道购置新的设备…但与此同时，她也在这里获得了最大的自由——<br><br><i>「调用2号设备舱的纽尔 · 伊曼望远镜，设置 100 倍天文单位，观测前方『星前云核』。」<br>「要特别注意粒子密度，一旦发现超致密结构，马上开始记录『恒星胚胎』的分裂过程。」</i><br><br>闲暇时，艾丝妲偶尔也会想起，自从自己接手这个空间站之后，黑塔女士已经许久没有出现。她也曾询问过，得到的只是「没有趣的新东西，我就不来了」这样的回复。<br><br><i>「…还不如听这小姑娘和你们吵架有趣。」</i><br><br>她想起很久以前的那一天，黑塔漫不经心地跟身边人说道。<br><br>回忆中的黑塔仿佛站在绚烂的星光中，带给她掌控星空与自己命运的力量。"
